import Welcome from "./sites/welcome"
import Home from "./sites/home"
import React from "react";
import {BrowserRouter as Router, Route, Switch, withRouter} from 'react-router-dom';
import { Provider } from "react-redux";
import store from "./store/store";
import Headerbar from "./componenets/headerbar"
import Calendar from "./sites/calendar"
import Employees from "./sites/employees"
import Team from "./sites/team"
import Vacations from "./sites/vacations"
import Settings from "./sites/settings"
import history from "./componenets/history";
const App = (props) => {

    return(
        <Provider store={store}>
            <Router>


                <Route exact path={'/'} component={Welcome}>
                {localStorage.getItem('authorization') ? <Redirect to="/home" /> : <Welcome />}
                </Route>

                {
                    window.location.pathname !== '/' ? <Headerbar /> : null
                }

                        <Route path={`/home`} component={Calendar}/>
                        <Route path={`/employees`} component={Employees} />
                        <Route path={`/team`} component={Team}/>
                        <Route path={`/vacations`} component={Vacations}/>
                        <Route path={`/settings`} component={Settings}/>

                </Router>
        </Provider>
    )

}
export default App;
